import UrlForm from "../components/UrlForm";
import "../MyProfolio.css";

// This is for the profolio
function Home1() {
  return (
    <div className="py-20">
      <div className="lg:grid lg:grid-cols-2 mx-auto max-w-7xl lg:px-8 lg:gap-8 justify-center">
        <div className="lg:py-24 mx-auto max-w-md px-4 sm:max-w-2xl sm:px-6">
          <h1 className="Header">
            One of the
            <br />
            <span>First Project</span>
          </h1>
          <p className="text-white text-base text-gray-300 sm:mt-5 mt-3">
            This is my first project using React framework and TailwindCSS!
          </p>
          <UrlForm />
        </div>
        <div className="mt-12 lg:relative">
          <div className="mx-auto max-w-md px-4 sm:max-w-2xl sm:px-6 lg:max-w-none lg:px-0">
            <img src="/UNI.png" alt="This is a unicorn." />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home1;
